  "metadata": {
    "playlistMetadataRenderer": {
      "title": "I Wanna Rock Super Gigantic Playlist 1: Hardrock, AOR, Metal and more !!! 5000 music videos !!!",
      "description": "UPDATED INFO !! !! READ THE WHOLE TEXT !!  Most viewed/popular music video on top. This playlist has 5000 Music videos and it has all the great bands in it: Metallica, Skid Row, Aerosmith, Bon Jovi, Tesla, U2, Simple Minds, Europé, Bad English, Journey, Stone Sour, Disturbed,  Foo Fighter, Genesis, Pink Floyd, Peter Gabriel, Yes, Sweet, Greenday, Iggy Pop, Winger, AC DC, Dio, Cinderella, Heart, Led Zeppelin, Black Sabbath, Judas Priest, The Beatles, Kansas, Nightwish, Guns´N Roses, Evanescence, Billy Idol,  Nirvana, Pearl Jam, Twisted Sister, Mr.Big, Night Ranger, Airbourne, David Bowie, Halestorm, Nickelback, Warrant, Steelheart, Joan Jett, Stryper, Y & T, Firehouse, Whitesnake, Deep Purple, Hinder, Gotthard  and many,  many, many more !!! It is almost like watching MTV/VH1 back in the day now mixed up with hot new videos and bands !!  \nThere is no Black/Death Metal music or Screamo bands in this list. I am Just trying to create the mix like MTV was when it was as its best. (Rock MTV)  \n\nTo get into this list the music video must have had a minimum of 30.000 views and a picture quality of 480p as lowest This playlist was created to give you a taste of the most popular music videos on Youtube....\nAll links here are official, honest links from record companies and bands. Only a few are not directly from the record companies but are allowed by Youtube and used in their own playlists.\n\nI created I Wanna Rock Super Gigantic Playlist 2 and you can find more videos there: https://www.youtube.com/playlist?list=PLWwAypAcFRgIB_op4fo4LWlwRBx2yxaaC",
      "androidAppindexingLink": "android-app://com.google.android.youtube/http/www.youtube.com/playlist?list=PLWwAypAcFRgKAIIFqBr9oy-ZYZnixa_Fj",
